import React, { Component } from 'react';
import Product from './Product';
import Title from './Title';
export default class Productlist extends Component{

state={
    products:[]
}


render(){

    return(
<React.Fragment>
    <div className="py-5">
        <div className="container">
        <Title name="our" title="products"></Title>
        </div>
    </div>
</React.Fragment>
    );
}

}
